import React from 'react';
import '../App.css'; 
import { useNavigate } from 'react-router-dom';
import SearchBar from './Search-bar'; // Import the SearchBar component

function LandingPage() {

    const navigate = useNavigate();
    const handleSignInClick = () => {
        navigate('/SignIn'); // Navigate to the sign-in page
    };
    const handleLoginClick = () => {
        navigate('/Login'); // Navigate to the sign-in page
    };



    return (
        <div className="landing-page">
            <header className="black-bar" > 
                <h1>hello</h1>
                <h1>Welcome to Our Website</h1>
                <p>landing page.</p>
                <div className='top-right-container'>
                <button className="sign-in-button" onClick={handleSignInClick}>
                Sign-In</button>
                <button className="login-button" onClick={handleLoginClick}>
                Login</button>

                </div>

            </header>
            <div className="centered-text">
                <div className='top-text'>
                <p> Enter your course to get started</p>
                </div>
                <div className='search-bar-container'>
                <SearchBar/>
                </div>
                <div className='bottom-text'>
                <p>I'd like to search by school</p>
                </div>
            </div>

            <div className="content-container">
                <div className="middle-left">Middle Left Content</div>
                <div className="middle-center">Middle Center Content</div>
                <div className="middle-right">Middle Right Content</div>
            </div>


            <div className="bottom-black-bar">
                <p>Footer content here</p>
            </div>



            {/* Add more content here */}

        </div>
        );
}

export default LandingPage;
